import { useState } from 'react'

const ButtonI = () => {
    const [count, setCount] = useState(0);

    const handleCount = () => {
        setCount( count + 1);
    };

    return (
        <button className="btn" onClick={ handleCount }>
            count = {count}
        </button>
    );
}

export default ButtonComponent;
